content:
电脑有问题啊！！！刚用几次，已经出现两次电脑没反应，彩色圈圈一直转的问题，到现在已经转了将近10分钟了，一直没反应。并且下东西速度非常慢！！才100m的东西竟然显示得下两天！！！
而且这次派送也有问题，买了一个星期，系统一直显示一个站点货物太多，让我等等。结果有天早晨莫名其妙地，就显示已收货！！吓得我赶紧起来打电话，结果送到了自提点，还是我自己搭车去取的&hellip;&hellip;
让我老觉得苹果电脑感觉被调包了&hellip;&hellip;不然怎么会出这种问题?

第二台Macbook，touch bar有点鸡肋，实用性不强。Mac系统确实很多软件不兼容，操作也不方便，但是没办法，谁让我是颜控？？
再说京东服务，电脑买回来6.3日激活，官网查询保修日期只到5.10日，明显不对，电话技术支持过期，电池循环3次。问客服，客服直接让我自己去找苹果客服&hellip;
目前有点后悔没买华为最新版那台超薄电脑。

我一直都很喜欢苹果产品，一直在用苹果手机，所以这次买电脑也是要买苹果的。

可是无奈运气不好&hellip;
收到机器用的过程中发现两个问题：
1.在黑色底色的锁屏界面会有一个来回挪动的白光圈
2.不知怎么出现了一个像照片的小方块，哪个界面都会有，去不掉，重启之后就没事了&hellip;&hellip;

所以，我选择了售后换新
京东的售后服务还是不错的，派人上门取件，处理速度也非常快，换新来回4天就搞定了，收到了换新机
可是&hellip; 也许是我运气太差了吧 ，
收到的换新机第二天就又出现了问题，用了没怎么一会儿照片库和Lr两个软件都相继意外退出&hellip;
感觉失望透顶了，刚收到的新机用了一会儿就崩溃两次，这个真心不敢留，所以就申请了退货
售后也很好，京东收到机子当天就给办理了退货

总体来说，我还是相当喜欢这个电脑的，外观相当好看，触控板也很好 ，有很多很方便快捷的操控，也很喜欢mac 的界面，只是我运气差碰到了不好的，哎&hellip;
因为之前换货的电脑我已经花钱贴了钢化膜，所以京东退给了京券。

现在又在纠结买哪款电脑，在考虑小米Pro，但又很喜欢这个电脑&hellip;
哎，这是要难死我这选择困难症

有条件的朋友我还是推荐这一款电脑，虽然有可能出现故障但售
